// Proj.js
import React, { useEffect } from 'react';
import './Proj.scss';

import {
  BrowserRouter as Router,
  Route,
  Routes,
  Navigate
} from 'react-router-dom';

import Header from './Header/Header';
import Footer from './Footer/Footer';
import Dashboard from './Dashboard/Dashboard';
import LoginPage from './LoginPage/LoginPage';
import StartPage from './StartPage/StartPage';
import SignupPage from './SignupPage/SignupPage';
import NewCategory from './NewCategory/NewCategory';
import { AuthProvider, useAuth } from './AuthProvider/AuthProvider';

// PrivateRoute component
const PrivateRoute = ({ element, ...rest }) => {
  const { authenticated } = useAuth();

  console.log('PrivateRoute - authenticated:', authenticated);

  if (authenticated === null) {
    // Wait until the authenticated state is initialized
    return null;
  }

  if (authenticated) {
    return element;
  } else {
    return <Navigate to="/login" replace />;
  }
};

function Proj() {
  useEffect(() => {
    // Log the authentication state when the component mounts
    const { authenticated } = useAuth();
    console.log('Proj - Initial Authenticated:', authenticated);
  }, []);

  return (
    <AuthProvider>
      <Router>
        <div className="mainContainer">
          <Header />
          <Routes>
            <Route path="/" element={<StartPage />} />
            <Route path="/login" element={<LoginPage />} />
            <Route path="/signup" element={<SignupPage />} />
            <Route path="/dashboard" element={<PrivateRoute element={<Dashboard />} />} />
            <Route path="/newcategory" element={<PrivateRoute element={<NewCategory />} />} />
          </Routes>
          <Footer />
        </div>
      </Router>
    </AuthProvider>
  );
}

export default Proj;
